import React from 'react';
// import ReactDOM from 'react-dom';
// import Footer from './Components/Footer';
import './App.css';
import './index.css';
import Products from './Components/Products';
import Contact from './Components/Contact';
import './styles.css';

const states = {
  currentPage: 'Home',
};

class App extends React.Component {
  constructor() {
    super();
    this.state = {
      ...states
    };
  }


  render() {
    return (
      <div>
          <NavBar />
        {this.state.currentPage === 'Home' &&
          <Main />  
        }
        {this.state.currentPage === 'Products' &&
          <Products />
        }
        {this.state.currentPage === 'Contact' &&
          <Contact />
        }
      </div>
    );
  };
};


class NavBar extends React.Component {
  onPageChange = (pageName) => {
    return (
    console.log('onPageChange', pageName)
    )
  };
  render() {
    return (
      <nav className="navbar navbar-expand-lg fixed-top">
        <button className="navbar-toggler " type="button" data-toggler="collapse" data-target="navagation-bar" onclick="myFunction()">
          <span className="navbar-toggler-icon">&#9776;</span>
        </button>
        <div class="collapse navbar-collapse" id="navigation-bar">
          <ul class="navbar-nav ml-auto">
            <li class="nav-item"> <a class="nav-link" onClick={this.onPageChange('Home')} href="index.js">HOME</a></li>
            <li class="nav-item"> <a class="nav-link" onClick={this.onPageChange('Products')} href="Products.js">PRODUCT</a></li>
            <li class="nav-item"> <a class="nav-link" onClick={this.onPageChange('Contact')} href="Contact.js">CONTACT</a></li>
          </ul>
        </div>
      </nav>
    )
  }
}

    class Main extends React.Component {
      onButtonClick = (buttonClick) => {
        return (
          console.log('onButtonClick', buttonClick)
        )
      };
      render() {
        return (
          <div className="main">
           <div id="mi-slider" class="mi-slider">
            <ul>
              <li><a onClick={this.onButtonClick('Shop Mens')} href="product1.html#Shop_Mens"><img src="http://www.pacs-apparrel.com/media/catalog/product/cache/1/image/e8aa4bfade2021a5ce50180a6b98b3df/D/i/Diamond_Supply_Co_Mens_Multi_Pacsun_90S_Colorblock_Denim_Jackets..jpg" alt="men model"></img><h2>Shop Men's</h2></a></li>
             <li><a onClick={this.onButtonClick('Shop Womens')} href="product1.html#Shop_Womens"><img src="https://images.asos-media.com/products/adidas-originals-mini-trefoil-logo-bodysuit-black/10501540-1-black?$XXL$&wid=513&fit=constrain" alt="women model"></img><h2>Shop Women's</h2></a></li>
              <li><a onClick={this.onButtonClick('Shop Tees')} href="product1.html#Shop_Tees"><img src="https://www.pacsun.com/dw/image/v2/AAJE_PRD/on/demandware.static/-/Sites-pacsun_storefront_catalog/default/dwa70908e0/product_images/0097513380034NEW_00_793.jpg?sw=458&sh=710&sm=fit" alt="tee model"></img><h2>Shop Tee's</h2></a></li>
               <li><a onClick={this.onButtonClick('Shop Sneakers')} href="product1.html#Shop_Sneakers"><img src="https://houseofheat.co/app/uploads/2019/05/sneaker-culture-is-eating-itself-alive-min-1200x1200.jpg" alt="jordans"></img><h2>Shop Sneaker's</h2></a></li>
             </ul>
             <ul>
               <li><a onClick={this.onButtonClick('Shop Accessories')} href="product1.html#Shop_Accessories"><img src="https://di2ponv0v5otw.cloudfront.net/posts/2018/03/29/5abd785ba4c4857a85230efc/m_5abd79af9a9455964460a78e.jpg" alt="bape bookbag"></img><h3>Shop Bag's</h3></a></li>
               <li><a onClick={this.onButtonClick('Shop Accessories')} href="product1.html#Shop_Accessories"><img src="https://hips.hearstapps.com/vader-prod.s3.amazonaws.com/1559833549-patek-philippe-grand-complications-silver-dial-18k-rose-gold-1559833533.jpg?crop=0.7333333333333334xw:1xh;center,top&resize=480:*" alt="watch"></img><h3>Shop Watches</h3></a></li>
               <li><a onClick={this.onButtonClick('Shop Accessories')} href="product1.html#Shop_Accessories"><img src="https://a248.e.akamai.net/f/248/9086/1.ccd/origin-d3.scene7.com/is/image/LuxotticaRetail/805289653653_shad_qt?$pngAlpha$" alt="sunglasses"></img><h3>Shop Sunglasses</h3></a></li>
